import React, { useState } from "react";
import { Form, Field } from "react-final-form";

import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";

const AddClassificadoDialog = ({ open, setOpen }) => {
  const handleClose = () => {
    setOpen(false);
  };

  const handleSubmit = () => {};

  return (
    <Dialog
      open={open}
      onClose={handleClose}
      aria-labelledby="form-dialog-novo-classificado"
    >
      <DialogTitle id="form-dialog-novo-classificado">
        Novo Classificado
      </DialogTitle>
      <DialogContent>
        <DialogContentText>
          Complete os com os seguintes dados para adicionar um novo
          classificado.
        </DialogContentText>
        <Form
          onSubmit={onSubmit}
          validate={validate}
          render={({ handleSubmit }) => (
            <form onSubmit={handleSubmit}>
              <h2>Simple Default Input</h2>
              <div>
                <label>First Name</label>
                <Field
                  name="firstName"
                  component="input"
                  placeholder="First Name"
                />
              </div>

              <h2>An Arbitrary Reusable Input Component</h2>
              <div>
                <label>Interests</label>
                <Field name="interests" component={InterestPicker} />
              </div>

              <h2>Render Function</h2>
              <Field
                name="bio"
                render={({ input, meta }) => (
                  <div>
                    <label>Bio</label>
                    <textarea {...input} />
                    {meta.touched && meta.error && <span>{meta.error}</span>}
                  </div>
                )}
              />

              <h2>Render Function as Children</h2>
              <Field name="phone">
                {({ input, meta }) => (
                  <div>
                    <label>Phone</label>
                    <input type="text" {...input} placeholder="Phone" />
                    {meta.touched && meta.error && <span>{meta.error}</span>}
                  </div>
                )}
              </Field>

              <button type="submit">Submit</button>
            </form>
          )}
        />
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} color="primary">
          Cancel
        </Button>
        <Button onClick={handleSubmit} color="primary">
          Subscribe
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default AddClassificadoDialog;
